RegisterNetEvent('sendProximityMessageOOC')
AddEventHandler('sendProximityMessageOOC', function(id, name, message)
  local myId = PlayerId()
  local pid = GetPlayerFromServerId(id)
  if pid == myId then
    TriggerEvent('chatMessage', "", {255, 0, 0}, "^* ^5 OOC ^3 > ^0" .. name .." ^1(#".. id ..") ^0" .. message)
  elseif GetDistanceBetweenCoords(GetEntityCoords(GetPlayerPed(myId)), GetEntityCoords(GetPlayerPed(pid)), true) < 29.999 then
    TriggerEvent('chatMessage', "", {255, 0, 0}, "^* ^5 OOC ^3 > ^0" .. name .." ^1(#".. id ..") ^0" .. message)
  end
end)

RegisterNetEvent('sendProximityMessageMe')
AddEventHandler('sendProximityMessageMe', function(id, name, message)
  local myId = PlayerId()
  local pid = GetPlayerFromServerId(id)
  if pid == myId then
    TriggerEvent('chatMessage', "", {255, 0, 0}, " ^3 > ^0" .. name .." ^1(#".. id ..") ^0" .. message)
  elseif GetDistanceBetweenCoords(GetEntityCoords(GetPlayerPed(myId)), GetEntityCoords(GetPlayerPed(pid)), true) < 29.999 then
    TriggerEvent('chatMessage', "", {255, 0, 0}, " ^3 > ^0" .. name .." ^1(#".. id ..") ^0" .. message)
  end
end)  

RegisterNetEvent('sendTwt')
AddEventHandler('sendTwt', function(header, message)
  TriggerEvent('chat:addMessage', { templateId = 'tweet', multiline = true, args = {header, message}})
end)  

RegisterNetEvent('sendTwtas')
AddEventHandler('sendTwtas', function(meta, header, message)
  print(meta .. ": " .. header .." ".. message)
  TriggerEvent('chat:addMessage', { templateId = 'tweet', multiline = true, args = {header, message}})
end)  

RegisterNetEvent('send911')
AddEventHandler('send911', function(header, message, flash)
	if flash then
		TriggerEvent('chat:addMessage', { templateId = '911redblue', multiline = true, args = {header, message}})
	else
		TriggerEvent('chat:addMessage', { templateId = '911white', multiline = true, args = {header, message}})
	end
end)  
